import { useEffect, useState } from "react";

const PRIORITY_COLORS = {
  Critical: "border-red-500",
  High: "border-orange-400",
  Medium: "border-yellow-400",
  Low: "border-green-400",
};

export default function Dashboard() {
  const [tickets, setTickets] = useState([]);
  const [expandedTicketId, setExpandedTicketId] = useState(null);

  useEffect(() => {
    fetch("http://localhost/tickets-api/tickets_latest.php")
      .then((res) => res.json())
      .then((data) => {
        const openTickets = data.filter(ticket => ticket.status !== 'Resolved' && ticket.status !== 'Closed');
        setTickets(openTickets);
      })
      .catch((err) => console.error("Eroare la fetch:", err));
  }, []);

  const toggleExpand = (id) => {
    setExpandedTicketId(expandedTicketId === id ? null : id);
  };

  const formatDate = (date) => {
    return typeof date === 'string' ? date.split('T')[0] : new Date(date).toLocaleDateString();
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-100 to-gray-300 py-10 px-6">
      <h1 className="text-4xl font-bold text-center mb-10 text-gray-800">Tickete Deschise</h1>
      <div className="max-w-4xl mx-auto flex flex-col gap-6">
        {tickets.map((ticket) => (
          <div
            key={ticket.id}
            className={`bg-white rounded-2xl shadow-lg border-l-8 p-6 transition-transform transform hover:scale-[1.01] duration-300 ${PRIORITY_COLORS[ticket.priority_name] || 'border-gray-300'}`}
          >
            <div className="flex justify-between items-center">
              <div>
                <h2 className="text-xl font-semibold text-gray-900 mb-2">{ticket.incident_title}</h2>
                <p className="text-gray-700 text-sm"><strong>Prioritate:</strong> {ticket.priority_name} | <strong>Status:</strong> {ticket.status}</p>
                <p className="text-gray-700 text-sm"><strong>Creat de:</strong> {ticket.created_by}</p>
                <p className="text-gray-700 text-sm"><strong>Data start:</strong> {formatDate(ticket.start_date)}</p>
              </div>
              <button
                onClick={() => toggleExpand(ticket.id)}
                className="ml-4 text-xs bg-blue-500 text-white px-3 py-1 rounded-full hover:bg-blue-600"
              >
                {expandedTicketId === ticket.id ? "âˆ’ Detalii" : "+ Detalii"}
              </button>
            </div>

            {expandedTicketId === ticket.id && (
              <div className="mt-4 border-t pt-4 text-sm text-gray-700">
                <p><strong>PersoanÄƒ asignatÄƒ:</strong> {ticket.assigned_person || "-"}</p>
                <p><strong>EchipÄƒ:</strong> {ticket.team_assigned_person || "-"}</p>
                <p><strong>Proiect:</strong> {ticket.project || "-"}</p>
                <p><strong>Comentariu:</strong> {ticket.comment || "-"}</p>
                <p><strong>Rezolvare:</strong> {ticket.resolution || "-"}</p>
                <p><strong>Data Ã®nchidere:</strong> {ticket.closed_date ? formatDate(ticket.closed_date) : "-"}</p>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}
